import React from 'react';
import Card from './components/card';
import ProfilePic from './assets/images/profile pic.jpg';

function App() {
  return (
    <div className='app center-items'>
      <Card title='Aviran Levi' imgSrc={ProfilePic} />
    </div>
  );
}

export default App;
